import React, { useEffect } from 'react';
// import { Link } from "react-router-dom";
import { useDispatch, useSelector } from 'react-redux';
import { getPokemonById } from '../store/actions';


export default function DetailPokemon(props){
    const pokemonId = props.match.params.id
    const detailPokemon = useSelector((state)=> state.pokemonDetail);  
    let dispatch = useDispatch();
    useEffect(() =>{
        dispatch(getPokemonById(pokemonId))
    }, []);
    const { id, name, hp, attack, defense, speed, height, weight, image, types} = detailPokemon;
    console.log(types)
    return(
        <div>
           <h4>Detalle de pokemon</h4>
           <h3>{id}</h3>
           <img src={image} alt={name}/>
           <h2>{name}</h2>
           <h5>HP: {hp}</h5>
           <h5>ATTACK: {attack}</h5>
           <h5>DEFENSE: {defense}</h5>
           <h5>SPEED: {speed}</h5>
           <h5>HEIGHT: {height}</h5>
           <h5>WEIGHT: {weight}</h5>
           <h4>Types </h4>

        </div>
    )
}
